  \"Survival and Abundance of Delmarva Fox Squirrels at Blackwater National Wildlife
  Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 20,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
