  \"survival-and-abundance-of-delmarva-fox-squirrels-at-blackwater-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Delmarva fox squirrel (DFS; Sciurus
  niger cinereus) is a subspecies of the Eastern fox squirrel. The DFS once ranged
  from southeastern Pennsylvania (Poole, 1932) to the Southern part of the Delmarva
  Peninsula (Taylor, 1973). In 1967, the DFS was declared endangered, and in 1993
  the DFS recovery team set up several sites to monitor DFS populations. We were contracted
  to assess adequacy of data collected at numerous sites (Fig 1) on and around the
  Blackwater National Wildlife Refuge to estimate survival and abundance of DFS.\",\n\t\"license_title\":
